Resolves #201 

Blacfire profiles, as expected VoidBacktrace is way faster. 
* `VoidBacktrace` - https://blackfire.io/profiles/7fe767de-c234-4d33-addd-ba217d8c6ce4/graph
* `InMemoryBacktrace` - https://blackfire.io/profiles/bf6d1854-44c5-4174-a842-de226f87092f/graph

Both profiles executed against following code:

```php
// $backtrace = new VoidBacktrace();
// $backtrace = new InMemoryBacktrace();

$matcher = (new MatcherFactory())->createMatcher($backtrace);

$value = [
    'users' => [
        [
            'id' => 1,
            'firstName' => 'Norbert',
            'lastName' => 'Orzechowicz',
            'enabled' => true,
        ],
        [
            'id' => 2,
            'firstName' => 'Micha',
            'lastName' => 'Dbrowski',
            'enabled' => true,
        ],
    ],
    'readyToUse' => true,
    'data' => new stdClass(),
];

$pattern = [
    'users' => [
        [
            'id' => '@integer@',
            'firstName' => '@string@',
            'lastName' => 'Orzechowicz',
            'enabled' => '@boolean@',
        ],
        [
            'id' => '@integer@',
            'firstName' => '@string@',
            'lastName' => 'Dbrowski',
            'enabled' => '@boolean@',
        ],
    ],
    'readyToUse' => true,
    'data' => '@wildcard@',
];


for ($i = 0; $i < 100; $i++) {
    $matcher->match($value, $pattern);
}
```

PHPMatcher API cleanup that replaces facade with regular class allowing to access last message/backtrace. 

### Changes

**Creating Matcher:** 
```diff
-$factory = new MatcherFactory();
-$matcher = $factory->createMatcher();
+$matcher = new PHPMatcher();
```

**Using Matcher**
```diff
-PHPMatcher::match($value, $pattern, $error)
+$matcher = (new PHPMatcher())->match($value, $pattern);;
```

**Accessing last error/backtrace**
```diff
+$matcher = new PHPMatcher();
+$matcher->match($value, $pattern);
+echo $matcher->error();
+echo $matcher->backtrace();
```
